import React, {useState} from "react";
import {Button, FlatList, Image, StyleSheet, Text, TouchableOpacity, View, Modal} from 'react-native';
import { gStyle } from "../styles/style";
import { Ionicons } from '@expo/vector-icons';
import Form from "./Form";


export default function Main({ navigation }) {
    const loadScene = () => {
        navigation.navigate('Main');
    }

    const [news, setNews] = useState([
        {name: 'Google', anons: 'Google!!!', full: 'Lorem ipsum dolor!', key: '1', img: 'data:image/jpeg;base64,'},
        {name: 'Apple', anons: 'Google!!!', full: 'Lorem ipsum dolor!', key: '2', img: 'data:image/jpeg;base64,'},
        {name: 'Facebook', anons: 'Google!!!', full: 'Lorem ipsum dolor!', key: '3', img: 'data:image/jpeg;base64,'},
    ]);

    const [modalWindow, setModalWindow] = useState(false);

    const addArticle = (article) => {
        setNews((list) => {
            article.key = Math.random().toString();
            return [
                article,
                ...list
            ]
        });
        setModalWindow(false);
    }

    return (
        <View style={gStyle.main}>
            <Modal visible={modalWindow}>

                <View style={gStyle.main}>
                    <Ionicons name="close" size={44} color="red" style={styles.iconClose} onPress={() => setModalWindow(false)}/>
                    <Text style={styles.title}>
                        Форма добавления статей
                    </Text>
                    <Form addArticle={addArticle} />
                </View>
            </Modal>
            <Ionicons name="add-circle-sharp" size={34} color="green" style={styles.iconAdd} onPress={() => setModalWindow(true)}/>
            <Text style={[gStyle.title, styles.header]}>Главная страница</Text>
            <FlatList data={news} renderItem={({item}) => (
                <TouchableOpacity style={styles.item} onPress={ () => navigation.navigate('FullInfo', item)}>
                    <Image style={styles.img} source={{uri: item.img}} />
                    <Text style={styles.title}>{ item.name }</Text>
                    <Text style={styles.anons}>{ item.anons }</Text>
                </TouchableOpacity>
            )}

            />
            <Button title='Открыть страницу' onPress={loadScene} />
        </View>
    )
}

const styles = StyleSheet.create({
    iconClose: {
        marginTop: 40,
        textAlign: 'center'
    },
    iconAdd: {
        textAlign: 'center',
        marginBottom: 15
    },
    header: {
        marginBottom: 30
    },
    item: {
        width: '100%',
        marginBottom: 30,
    },
    title: {
        fontFamily: 'mt-bold',
        fontSize: 22,
        textAlign: 'center',
        marginTop: 20,
        color: '#474747'
    },
    anons: {
        fontFamily: 'mt-light',
        fontSize: 16,
        textAlign: 'center',
        marginTop: 5,
        color: '#474747'
    },
    img: {
        width: '100%',
        height: 200
    }
});
